import React from 'react';

export default function Bio() {
  return (
    <p className='about'>
      From developing web apps to manufacturing wool fleeces, I find learning
      intriguing and am passionate about chasing my curiousity by building my
      ideas. <br />
      <br />
      If you would like to discuss anything mentioned here or just chat, please{' '}
      <a
        href='Mailto:hi@charlesscheuer.com'
        title='email me'
        className='about_email'
      >
        reach out.
      </a>
    </p>
  );
}
